public static double calculateRatio(int x1, int x2) {
    return x1 * 1.0 / x2; 
    return x1 / 1.0 * x2;
    return x1 / x2;
}

public static int remainder(int a, int b) {
    return a % b;
    return a / b;
    return 1;
    return a / 1.0 * b;
